    def parse(self, response):
        data = json.loads(response.text)
        total_pages = data['page']['totalItems'] / data['page']['itemsPerPage']
        current_page = data['page']['pageNumber']

        for product in data['products']:
            if product.get('ean',None) not in self.sysgtin:
                continue
            item = ProductItem()
            item['providerkey'] = product.get('sku', None)
            item['gtin'] = product.get('ean', None)
            item['productType'] = product['categories'][0].get('categoryName', None) if product.get('categories') else None
            item['countryoforigin'] = product.get('country', None)
            item['brand'] = product.get('brand', None)
            item['manufacturerkey'] = product.get('manufacturerPartNumber', None)
            item['title'] = product.get('title', None)
            item['longdesciprtion'] = product.get('longDescription', None)
            for specItem in self.parse_spec(product.get('techSpecs', {}), product.get('ean', None)):
                yield specItem
            yield item

        if current_page < total_pages - 1:
            next_page = current_page + 1
            yield from self.start_requests(next_page)

    def parse_spec(self, techSpecs, ean):
        if not ean:
            return
        for section in techSpecs.get('sections', []):
            specItem = SpecItem()
            for spec in section.get('specifications', []):
                specItem['providerKey'] = ean
                specItem['SpecificationKey'] = spec.get('title', None)
                specItem['SpecificationValue'] = spec.get('value', None)
                yield specItem

